import React from 'react'
import "../styles/Inventory.css";
import Item from "./InventoryItem";
import Button from '@mui/joy/Button';
import Add from '@mui/icons-material/Add';
import { createTheme,} from '@mui/material/styles';

const { palette } = createTheme();
const { augmentColor } = palette;
const createColor = (mainColor) => augmentColor({ color: { main: mainColor } });
const theme = createTheme({
  palette: {
    aquamarine: createColor('#3edaa6'),
  },
});

var listProps=[<Item/>,<Item/>,<Item/>,<Item/>,<Item/>,<Item/>,<Item/>,<Item/>,<Item/>,<Item/>,<Item/>,<Item/>,<Item/>,<Item/>,<Item/>,<Item/>,<Item/>,<Item/>,<Item/>];

function Inventory() {
  return (
    <div className='inventory'>
      {listProps.map(item => {return <div className='item'>{item}</div>})}
      <Button startDecorator={<Add />} 
              variant="outlined" 
              onClick={()=>{}}
              size="lg">Add props</Button>
    </div>
  )
}

export default Inventory
